import React from "react";

const Home = () => {
    return (
        <>
            <section className>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-11 ms-auto">
                            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                                <h1 className="fw-bolder">Hi, my name is <span className="greenText">Amit Ramani</span></h1>
                                <h2 className="fw-bold my-3">I'm the Full Stack Developer</h2>
                                <div className="mt-4">
                                    <a href="" target="_blank" className="btn btn-outline-dark btn-lg">Resume</a>
                                </div>
                            </div>
                            <div className="col-md-6 order-2 order-lg-1">
                                <img src="" alt=""/>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Home;
